import React, { Component } from "react";
import Select from "react-select";
import axios from "axios";
import AdminPanelService from "../service/AdminPanelService";
import TenyesztokService from "../service/TenyesztokService";

class KeresKuldComponent extends Component {
  constructor(props) {
    super(props);

    this.state = {
      anyabalful: "",
      anyajobbful: "",
      apabalful: "",
      apajobbful: "",
      bakok: "",
      nostenyek: "",
      szuldat: "",
      fajta: "",
      szin: "",
      tenyeszto: "",
      tenyesztok: [],
      fajtak: [],
    };
  }
  componentDidMount() {
    TenyesztokService.getTenyesztoById(this.state.id).then((res) => {
      let tulaj = res.data;
      console.log(res.data);
      this.setState({
        id: res.data.id,
        anyabalful: res.data.anyabalful,
        anyajobbful: res.data.anyajobbful,
        apabalful: res.data.apabalful,
        apajobbful: res.data.apajobbful,
        bakok: res.data.bakok,
        nostenyek: res.data.nostenyek,
        szuldat: res.data.szuldat,
        fajta: res.data.fajta,
        szin: res.data.szin,
      });
      console.log(tulaj);
    });
    this.getOptions();
    console.log(this.state);
  }

  saveOrUpdateTulaj = (e) => {
    e.preventDefault();
    let tulajUpdate = {
      id: this.state.id,
      nev: this.state.nev,
      cim: this.state.cim,
      telszam: this.state.telszam,
      biro: this.state.biro,
      egyesuletId: this.state.egyesuletId,
    };
    let tulajAdd = {
      nev: this.state.nev,
      cim: this.state.cim,
      telszam: this.state.telszam,
      biro: this.state.biro,
      egyesuletId: this.state.egyesuletId,
    };
    console.log("tulaj => " + JSON.stringify(tulajAdd));
    console.log("tulaj => " + JSON.stringify(tulajUpdate));

    TenyesztokService.addTenyeszto(tulajAdd).then((res) => {});
  };
  async getOptions() {
    const res = await axios.get("http://localhost:8090/api/egyesulet");
    const data = res.data;

    const options = data.map((response) => ({
      value: response.id,
      label: response.nev,
    }));
    this.setState({ selectOptions: options });
    console.log(options);
  }
  render() {
    return (
      <div className="keresContainer">
        <div className="keresDiv">
          <div>
            <h3>Tenyeszto adatok</h3>
            <div>
              <input
                type="text"
                name="tenyeszto"
                id=""
                value="Tenyeszto neve"
              />
            </div>
          </div>
          <div>
            <h3>Fajta adatai</h3>
            <div>
              <input type="text" name="Fajta" id="" value="Fajta" />
            </div>
            <div>
              <input type="text" name="Szin" id="" value="Szin" />
            </div>
          </div>
          <div>
            <h3>Szulok adatai</h3>
            <div>
              <input type="text" name="Anyajobbful" id="" value="Anyajobbful" />
            </div>
            <div>
              <input type="text" name="Anyabalful" id="" value="Anyabalful" />
            </div>
            <div>
              <input type="text" name="Apajobbful" id="" value="Apajobbful" />
            </div>
            <div>
              <input type="text" name="Apabalful" id="" value="Apabalful" />
            </div>
          </div>
          <div>
            <h3>Kolykok adatai</h3>
            <div>
              <input type="number" name="bakok" id="" value="Bakok szama" />
            </div>
            <div>
              <input
                type="number"
                name="nostenyek"
                id=""
                value="Nostenyek szama"
              />
            </div>
            <div>
              <input
                type="date"
                name="szuletes"
                id=""
                value="Szuletesi datum"
              />
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default KeresKuldComponent;
